      <button tabIndex="0">Button 1</button>
      <button tabIndex="0">Button 2</button>
      <button tabIndex="0">Button 3</button>
      <button tabIndex="0">Button 4</button>
      <button tabIndex="0">Button 5</button>
    </section>
  );
};

export default KeyboardNavigator;
